using System.Net;
using System.Text;
using Microsoft.AspNetCore.Mvc;
using Newtonsoft.Json.Linq;
using NLog;

namespace PdfConverter;

[ApiController]
[Route("ConvertDocxToPdf")]
public class PdfConvertController : ControllerBase {
    private readonly Logger _log = LogManager.GetLogger("PdfConvert.PdfConvertController");

    private readonly string _docxExampleString = "";

    [HttpPost]
    public byte[] ConvertDocxToPdf() {
        _log.Info("ConvertDocxToPdf request received.");

        // Parse request body. If Body is empty - example document is set.
        using var reader = new StreamReader(Request.Body, Encoding.UTF8, true, 1024, true);
        string? docxData = null;
        try {
            var body = reader.ReadToEndAsync();
            if (string.IsNullOrEmpty(body.Result) == false) {
                var parsedBody = JObject.Parse(body.Result);
                docxData = parsedBody["DocxData"]?.ToString();
            } else {
                docxData = _docxExampleString;
            }
        } catch (Exception ex) {
            _log.Error($"failed to parse ConvertDocxToPdf request body. Error: {ex}");
            Response.StatusCode = (int)HttpStatusCode.BadRequest;
            return Array.Empty<byte>();
        }

        if (docxData != null) {
            var docxBytes = Convert.FromBase64String(docxData);

            var pdfConvertService = new PdfConvertService();

            // Calling convert to Pdf twice in different tasks to make it parallel (and fail).
            var tasks = new List<Task> {
                Task.Run(() => {
                    pdfConvertService.GetPdfBytes(docxBytes);
                }),
                Task.Run(() => {
                    pdfConvertService.GetPdfBytes(docxBytes);
                })
            };

            Task t = Task.WhenAll(tasks);
            try {
                t.Wait();
            } catch (Exception ex) {
                _log.Error($"ConvertDocxToPdf failed. Error info: {ex}");
            }
        }

        return Array.Empty<byte>();
    }
}